// /src/App.js
import React from 'react';
import PacjentList from './components/PacjentList';
import LekarzList from './components/LekarzList';  // Analogicznie dla innych komponentów

const App = () => {
  return (
    <div>
      <h1>Moja Aplikacja Medyczna</h1>
      <PacjentList />
      <LekarzList />  {/* Analogicznie dla innych komponentów */}
    </div>
  );
};

export default App;
